    return (
      <div className="expense-item">
        <div>
          <div>MArch</div>
          <div>2022</div>
          <div>Sunday</div>
        </div>
        <div className="expense-item__description">
          <h2>title</h2>
          <div className="expense-item__price">Rs. 500</div>
        </div>
      </div>
    );
  });
};

